import { styled } from "styled-componen";

const ContainerImagem = styled.div`
   .image-container {
  outline: 2px solid blue;
  max-width: 500px;
  min-height: 500px;
  display: flex;
  flex-direction: column;
  align-items: center;
}
.image-container, p {
  max-width: 80%;
}
.BodyContent{
  margin-top: 80px;
}
`;

export {ContainerImagem}
